import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

class CartDialog extends React.Component {
  state = {
    open: false,
  };

  handleClickOpen = () => {
    this.setState({ open: true });
  };

  handleClose = () => {
    this.setState({ open: false });
  };

  render() {
    return (
      <div>
        <button className= "btn-light.active btn-tranparent" onClick={this.handleClickOpen}>
        <div id ='test'>
            <span id="numberOfItemsAdded">0</span>
            <i class="fas fa-box-open shoppingChart " style={{fontSize : "20px"}}></i>
            </div>
        </button>
        <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="alert-dialog-title"
          aria-describedby="alert-dialog-description"
        >
          <DialogTitle id="alert-dialog-title">{"Use Google's location service?"}</DialogTitle>
          <DialogContent>
            <DialogContentText id="alert-dialog-description">

            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <button onClick={this.handleClose} className="btn btn-secondary">
              Continue
            </button>
            <button onClick={this.handleClose} className="btn btn-secondary">
              Checkout
            </button>
          </DialogActions>
        </Dialog>
      </div>
    );
  }
}

export default CartDialog;
